/** @jsx jsx */
import { jsx, css } from '@emotion/core'
import styled from '@emotion/styled'
import { animated, useSpring, interpolate } from 'react-spring'

export default function Index(){
  return(
    <div>
      <AnimatedCard>
        <img src="https://images.pexels.com/photos/3558597/pexels-photo-3558597.jpeg?auto=compress&cs=tinysrgb&dpr=2&w=500" alt=""/>
      </AnimatedCard>
    </div>
  )
}

const AnimatedCard = styled(animated.div)`
  width: 200px;
  height: 200px;
  border-radius: 10px;
  overflow: hidden;
  box-shadow: 0 10px 40px rgba(0,0,0,.1);
  img {
    width: 100%;
    height: 100%;
    object-fit: cover;
  }
`
